import React, { FC } from 'react';
import { Layout } from 'antd';
import navBar from '../../Components/Navbar';

const { Header, Footer, Sider, Content } = Layout;


const HomePage: FC = () => (
  <div >
 <Layout>
      <Header>
          <navBar></navBar>
      </Header>
      <Layout>
        <Sider>Sider</Sider>
        <Content>Content</Content>
      </Layout>
      <Footer>Footer</Footer>
    </Layout>
  </div>
);

export default HomePage;
